import com.eviware.soapui.support.XmlHolder
import com.eviware.soapui.impl.wsdl.testcase.WsdlTestRunContext
def xmlGetById = testRunner.testCase.testSuite.testCases["GetById"].testSteps["GetAddById"].getPropertyValue("Request")
log.info xmlGetById
def nodeaddIdpropvalue = testRunner.testCase.testSuite.testCases["GetById"].getPropertyValue("addid")
log.info nodeaddIdpropvalue
//Put data inside the XML node - XmlHolder class
def putData = new XmlHolder(xmlGetById)

//Use the setNodeValue method of XmlHolder class
//putData.setNodeValue("XPATH Expression of the Request of addEmployee TEST STEP", "Value to be put in the nodes" )
putData.setNodeValue("//def:customerAddressRepositoryV1GetByIdRequest//addressId",nodeaddIdpropvalue)
def newXmlGetbyIdTestStep = putData.getXml()
testRunner.testCase.testSuite.testCases["GetById"].testSteps["GetAddById"].setPropertyValue("Request",newXmlGetbyIdTestStep)
def GetByIdTestStep = testRunner.testCase.testSuite.testCases["GetById"].testSteps["GetAddById"]

//Now move the context from ScriptTestCase TEST CASE to AddEmp TEST CASE - create an object of WsdlTestRunContext class and pass the pointer 
def contextPointer = new  WsdlTestRunContext(GetByIdTestStep)

//Run/Trigger the submit button of addEmployee TEST STEP
GetByIdTestStep.run(testRunner,contextPointer)

